import axios from 'axios'

export const GET_RAZAS = "GET_RAZAS"
export const getRazas = () => {
   return async (dispatch) => {
      const response = await axios('http://localhost:3001/dogs')
      return dispatch({
         type: GET_RAZAS,
         payload: response.data,
      })
   }
}
